import React from 'react';
import logo from './logo.svg';
import {FaTimes} from "react-icons/fa/index";
import './App.css';

class People extends React.Component{
componentDidMount(){
  fetch('response.json').then((response)=>response.json()).then(
    (result)=>{result.map((data)=>{console.log(data);})}
  )
}
render(){
  return (<div>Hello</div>);
}
}

class App extends React.Component {
render(){ 
 return (<div className="container list-box">
  <People />
  </div>);
}
}

export default App;
